import {mapParams} from "../maps/Level1";

class Enemy {
    constructor(
        public progress:number = 0,
        ) {
    }

    public static drawEnemy(context:CanvasRenderingContext2D) {
        context.rect(mapParams.gridStep / 2, mapParams.gridStep / 2, mapParams.gridStep /2, mapParams.gridStep / 2 )
        context.fillStyle = 'red'
        context.fill()
    }
}

export default Enemy;
